import React from "react";
import { Link } from "react-router-dom";
import styles from "./Navigation.module.css";

const Navigation = () => {
  return (
    <nav className={styles.nav - wrapper}>
      <Link to="/Work">
        <p>Beomsoo</p>
      </Link>
      <div className={styles.select - area}>
        <Link to="/Work">
          <p>Work</p>
        </Link>
        <Link to="/About">
          <p>About</p>
        </Link>
        <p>Contact</p>
      </div>
    </nav>
  );
};

export default Navigation;
